CREATE TABLE `produto` (
  `id_estoque` int NOT NULL AUTO_INCREMENT,
  `codigo` int DEFAULT NULL,
  `produto` text,
  `saldo` int DEFAULT '0',
  `status` varchar(45) DEFAULT 'ativo',
  `tipo` varchar(45) DEFAULT 'nacional',
  `preco_compra` decimal(15,2) DEFAULT NULL,
  `dt_cadastro` datetime DEFAULT NULL,
  `categoria_id_categoria` int NOT NULL,
  `fornecedor_id_fornecedor` int NOT NULL,
  PRIMARY KEY (`id_estoque`),
  KEY `fk_produto_categoria_idx` (`categoria_id_categoria`),
  KEY `fk_produto_fornecedor1_idx` (`fornecedor_id_fornecedor`),
  CONSTRAINT `fk_produto_categoria` FOREIGN KEY (`categoria_id_categoria`) REFERENCES `categoria` (`id_categoria`),
  CONSTRAINT `fk_produto_fornecedor1` FOREIGN KEY (`fornecedor_id_fornecedor`) REFERENCES `fornecedor` (`id_fornecedor`)
) ENGINE=InnoDB AUTO_INCREMENT=709 DEFAULT CHARSET=utf8;
